INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, "リリ", 2, 0, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 125801, 321, 40011, 24001, 1);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, "クリア", 2, 0, 1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 126001, 322, 40011, 24001, 2);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (1, "プレシア", 2, 0, 1, "んーと。\nこれ、あげる。\nはい", 126101, 323, 40011, 24001, 3);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (2, "リリ", 2, 0, 1, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 125801, 324, 40011, 24001, 4);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (2, "クリア", 2, 0, 1, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 126001, 325, 40011, 24001, 5);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (2, "プレシア", 2, 0, 1, "お兄。\nきてくれて、うれしい", 126101, 326, 40011, 24001, 6);
